function Login() {
  return (
    <div className="container">
      <h1>Login System</h1>
      <div className="information">
        <form action="">
          <input
            className="form-control"
            type="text"
            placeholder="Default input"
            aria-label="default input example"
          />
        </form>
      </div>
    </div>
  );
}

export default Login;
